import styled from "styled-components";
import four from "../../image/404.png";
import oops from "../../image/oops.png";
const NotFoundWrap = styled.article`
  text-align: center;
  display: flex;
  flex-direction: column;
  min-height: calc(100vh - 8rem);
  justify-content: center;
  align-items: center;
  .oops {
    max-width: 15rem;
    margin-bottom: 2rem;
  }
  .four {
    max-width: 25rem;
  }
  .desc {
    color: var(--gray-color);
  }
`;
const NotFound = () => {
  return (
    <NotFoundWrap>
      <img src={oops} alt="oops" className="oops" />
      <img src={four} alt="four" className="four" />
      <p className="desc">We looked everywhere for this page.<br></br>
      Are you sure the website URL is correct?<br></br>
      Get in touch with the site owner.</p>
    </NotFoundWrap>
  );
};

export default NotFound;
